          Services
        </Link>
        <Link
          to="/explore"
          className="text-gray-700 hover:text-green-600 transition"
        >
          Explore
        </Link>
        <Link
          to="/contact"
          className="text-gray-700 hover:text-green-600 transition"
        >
          Contact
        </Link>
      </nav>

